import React from "react";
import PlayerCard from "./PlayerCard";
import "../App.css";

const CardContainer = ({name,img,statistics,searchTerm}) => {
//   console.log(name,img,statistics);
  return (
    <div className="card-container">
      <PlayerCard name={name} img={img} statistics={statistics} searchTerm={searchTerm}/>
    </div>
  );
};

export default CardContainer;
